$.axT=A.a(["\uba4b\uc9c4 \ud48d\uacbd\uc744 \uc790\ub791\ud558\ub294 \uc81c\ucc9c \uccad\ud48d\ud638\ub97c \uc990\uae38 \ubc29\ubc95\uc73c\ub85c \uccad\ud48d\ud638 \ubaa8\ub178\ub808\uc77c\uc744 \uc18c\uac1c\ud569\ub2c8\ub2e4. \ubaa8\ub178\ub808\uc77c\uc744 \ud0c0\uace0 \ucd08\ub85d\ucd08\ub85d\ud55c \ub098\ubb34\uc640 \ud480\uc232\uc744 \uc9c0\ub098\uba74 \ube44\ubd09\uc0b0 \ud558\ub298 \uc804\ub9dd\ub300\ub85c \uc774\ub3d9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\uc804\ub9dd\ub300\uc5d0\uc11c \uc0b0\uacfc \ud638\uc218\uac00 \uc5b4\uc6b0\ub7ec\uc9c4 \uccad\ud48d\ud638\uc758 \ubaa8\uc2b5\uc744 \uc870\ub9dd\ud574\ubcf4\uc138\uc694!","\uae08\uc218\uc0b0 \uc790\ub77d\uc758 \uace0\ucc30 \uc815\ubc29\uc0ac\ub294 662\ub144 \uc758\uc0c1\ub300\uc0ac\uac00 \uc138\uc6b4 \uc808\ub85c \uac00\ub294 \uae38\uc740 \uc9e7\uace0 \uad75\uc740 \ud5d8\ud558\uc9c0\ub9cc \uc774 \ubaa8\ub4e0 \uac83\uc774 \uc6a9\uc11c\ub420 \uc544\ub984\ub2e4\uc6b4 \uc815\ubc29\uc0ac\uc758 \ube44\uacbd\uc744 \ubcf4\ub294 \uc21c\uac04 \uc640! \ud558\ub294 \uac10\ud0c4\uc0ac\uac00 \uc808\ub85c \ud130\uc838 \ub098\uc624\uac8c \ub420 \uba85\uc18c\uc785\ub2c8\ub2e4. \ud55c \ud3ed\uc758 \uadf8\ub9bc\uac19\uc740 \ub2e8\ud48d\uacfc \uccad\ud48d\ud638\uc758 \ud48d\uacbd\ub3c4 \ubcfc \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\uae08\uc218\uc0b0\uc758 \uc228\uc740 \ube44\uacbd\uc778 \uc6a9\ub2f4\ud3ed\ud3ec\ub294 \uc6c5\uc7a5\ud568\ubcf4\ub2e4\ub294 \uace0\uc988\ub109\ud568\uc774 \ub9e4\ub825\uc801\uc778 \ud3ed\ud3ec\ub85c, \uc870\uae08 \ub354 \uc704\uc5d0 \uc704\uce58\ud55c \uc804\ub9dd\ub300\uc5d0\uc11c\ub294 \ud3ed\ud3ec\uc640 \uc544\ub984\ub2e4\uc6b4 \uc790\uc5f0\uc744 \ud55c\ub208\uc5d0 \ub0b4\ub824\ub2e4 \ubcfc \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\uc218\uc0b0\uba74\uc758 \uc544\ub984\ub2e4\uc6b4 \uccad\ud48d\ud638\uc640 \uae08\uc218\uc0b0, \uc625\uc21c\ubd09\uc774 \ub9cc\ub098\ub294 \uc625\uc21c\ub300\uad50 \uc77c\ub300\ub97c \uc911\uc2ec\uc73c\ub85c \uc6b4\uc601\ud558\ub294 \uce74\ub204, \uce74\uc57d \uccb4\ud5d8\uc7a5\uc785\ub2c8\ub2e4.","\uc545\uc5b4\uac00 \ucda9\uc8fc\ud638\ucabd\uc73c\ub85c \uba38\ub9ac\ub97c \ub0b4\ubc00\uace0 \ub2e4\uac00\uac00\ub294 \ubaa8\uc2b5 \uac19\ub2e4\uace0 \ud558\uc5ec \uc545\uc5b4\ubd09 \uc774\ub77c\uace0 \ubd88\ub9ac\uba70, \uace7 \ud0d0\ubc29\ub85c\uac00 \uac1c\uc124\ub41c\ub2e4\uace0 \ud569\ub2c8\ub2e4!","\ucd08\ub85d \ud480\ubc2d\uc5d0 \ub458\ub7ec\uc2f8\uc5ec \uc88c\ub300 \ub09a\uc2dc\ub97c \uc990\uae30\ub294 \ubaa8\uc2b5\uc774 \uc790\uc5f0\uacfc \uc5b4\uc6b0\ub7ec\uc9c0\ub294 \ud48d\uacbd\uc744 \uba40\ub9ac\uc11c \uac10\uc0c1\ud558\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc7a0\uc2dc \uc9c0\ub098\uac00\ub294 \uae38\uc5d0 \ub4e4\ub9ac\uc2dc\ub294 \uac83\uc744 \ucd94\ucc9c\ud569\ub2c8\ub2e4. \ub2e4\ub9cc \ud5d8\ud55c \uc9c4\uc785\ub85c\ub97c \uc8fc\uc758\ud574\uc8fc\uc138\uc694!","\ub2ec\ucc9c \ubb3c\uae38\uc744 \ub530\ub77c \ub458\ub7ec\uce5c \uc5ec\ub35f \ubd09\uc6b0\ub9ac\uc5d0\uc11c \uc774\ub984\uc744 \uc5bb\uc740 \uc218\uc8fc\ud314\ubd09(493M)\uc740 \ubd09\uc6b0\ub9ac\uc640 \ubd09\uc6b0\ub9ac \uc0ac\uc774\ub85c \uc791\uc740 \ud3ed\ud3ec\uac00 \uc0dd\uae30\uace0 \ucd9c\ub801\ub2e4\ub9ac\uac00 \ub193\uc5ec \uc788\uc73c\uba70 \uaddc\ubaa8\ub294 \uc791\uc9c0\ub9cc \uba4b\uc9c4 \ud48d\uacbd\uc744 \ubcf4\uc720\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc774\uacf3\uc5d0\uc11c \ucc28\ubc15\ucea0\ud551\uc740 \uc5b4\ub5a8\uae4c\uc694?"],t.m)
